pattern = r'"(.*?)"'

# List to store extracted text
extracted_text = []

# Iterate over the list of strings and extract text within double quotes
for string in lines:
    match = re.search(pattern, string)
    if match:
        # Group 1 contains the text within double quotes
        extracted_text.append(match.group(1))

# Printing the extracted text
print(len(set(extracted_text)))
